<!doctype html>
                <meta charset="UTF-8">
                <title>Webpack Visualizer</title>
                <style>html {
    background-color: #f7eedf;
    color: #333;
}

body {
    font-family: sans-serif;
    margin: 10px auto 0;
    width: 750px;
    padding: 0 10px;
}

a,
.destyledButton {
    color: #347AB7;
}

p {
    margin-top: 0.5em;
}

svg {
    vertical-align: middle;
}

h1 {
    font-family: "Oswald", "HelveticaNeue-CondensedBold", "Arial Narrow", sans-serif;
    font-weight: bold;
    font-size: 70px;
    text-transform: uppercase;
    text-align: center;
}

hr {
    border: 0 none;
    border-top: 1px solid #aaa;
}

code {
    font-size: 16px;
}



.breadcrumbs {
    height: 1em;
    margin: 1em 0;
}

.uploadArea {
    position: relative;
    margin: 0 auto;
    min-height: 350px;
}
.uploadArea--needsUpload {
    border: 2px dashed #AC9062;
    border-radius: 10px;
    cursor: pointer;
}

.uploadArea--dragging {
    border-style: solid;
    background-color: #E6D4B6;
}

.uploadArea-uploadMessage {
    display: none;
    font-size: 1.9em;
    text-align: center;
    margin-top: 100px;
    pointer-events: none;
}
.uploadArea--needsUpload .uploadArea-uploadMessage {
    display: block;
}

.uploadArea-uploadMessage small {
    font-size: 0.5em;
}


.chart {
    position: relative;
    margin: 0 auto;
    min-height: 350px;
}
.chart--large {
    width: 950px;
    margin-left: -100px;
}



.hiddenFileInput {
    width: 0px;
    height: 0px;
    visibility: hidden;
}

.chart path {
    stroke: #fff;
}

.details {
    position: absolute;
    top: 325px;
    left: 50%;
    width: 170px;
    margin-left: -85px;
    font-size: 14px;
    text-align: center;
    color: #666;
    z-index: -1;
    overflow: hidden;
    text-overflow: ellipsis;
}

.chart--large .details {
    top: 425px;
}

.details-size {
    font-size: 0.9em;
    margin-top: 1em;
}

.details-name {
    font-weight: bold;
}

.details-subText {
    min-height: 1.2em;
}

.details-percentage {
    margin: 0.4em 0 0em;
    font-size: 2.4em;
    line-height: 1em;
}



.errorMessage {
    margin-top: 2em;
    padding: 0.8em 1em;
    border: 1px solid #ab2222;
    color: #ab2222;
}


footer {
    margin-top: 4em;
}

footer h2 {
    margin: 1.5em 0 0.5em;
    font-size: 1.3em;
}



.destyledButton {
    background: none;
    border: 0 none;
    cursor: pointer;
    font-size: inherit;
    padding: 0;
    text-decoration: underline;
}

it-touch-callout: none;\\n      display: block;\\n      position: relative;\\n      .hairline('top');\\n      .button-common();\\n    }\\n  }\\n\\n  &-button-active {\\n    background-color: @fill-tap;\\n  }\\n\\n  &-input-container {\\n    margin-top: @v-spacing-md;\\n    .hairline('all', @border-color-base, @radius-sm);\\n  }\\n  &-input {\\n    height: 36 * @hd;\\n    line-height: @line-height-base;\\n\\n    &:nth-child(2) {\\n      position: relative;\\n      .hairline('top');\\n    }\\n    input {\\n      position: relative;\\n      border: 0;\\n      width: 98%;\\n      height: 34 * @hd;\\n      top: 1PX;\\n      box-sizing: border-box;  // maybe not need it ?\\n\\n      margin: 0;\\n      &::placeholder {\\n        font-size: @font-size-base;\\n        color: #ccc;\\n        padding-left: @h-spacing-md;\\n      }\\n    }\\n  }\\n\\n  &&-transparent.@{modalPrefixClass}-android {\\n    .@{modalPrefixClass}-content {\\n      border-radius: 0;\\n\\n      .@{modalPrefixClass}-header {\\n        padding: @v-spacing-md 24 * @hd 12 * @hd;\\n\\n        .@{modalPrefixClass}-title {\\n          text-align: left;\\n          font-size: 21 * @hd;\\n          color: @color-text-base;\\n        }\\n      }\\n\\n      .@{modalPrefixClass}-body {\\n        color: @color-text-base;\\n        text-align: left;\\n        padding: 0 24 * @hd @v-spacing-lg;\\n\\n        .@{modalPrefixClass}-input-container {\\n          .hairline-remove('all');\\n          .hairline('bottom');\\n          .@{modalPrefixClass}-input {\\n            &:first-child {\\n              .hairline-remove('top');\\n            }\\n          }\\n        }\\n      }\\n\\n      .@{modalPrefixClass}-footer {\\n        padding-bottom: 2 * @v-spacing-sm;\\n\\n        .@{modalPrefixClass}-button-group-h {\\n          overflow: hidden;\\n          .hairline-remove('top');\\n          justify-content: flex-end;\\n          padding: 0 2 * @v-spacing-sm;\\n\\n          .@{modalPrefixClass}-button {\\n            flex:  white-space: nowrap;\\n}\\n\\n.background(@start: #ffffff, @end: #000000) {\\n  background: @end;\\n  background-image: -webkit-gradient(linear, left top, left bottom, from(@start), to(@end)); /* Saf4+, Chrome */\\n  background-image: linear-gradient(@start, @end);\\n}\\n\",\"@import '../../style/mixins';\\n@import '../../style/themes/default';\\n\\n@modalPrefixClass: am-modal;\\n\\n@import './Dialog.less';\\n\\n.@{modalPrefixClass} {\\n  .button-common() {\\n    box-sizing: border-box;\\n    text-align: center;\\n    text-decoration: none;\\n    outline: none;\\n    color: @color-link;\\n    font-size: @modal-button-font-size;\\n    height: @modal-button-height;\\n    line-height: @modal-button-height;\\n    display: block;\\n    .ellipsis();\\n  }\\n\\n  &-button-group-h {\\n    position: relative;\\n    .hairline('top');\\n    display: flex;\\n\\n    .@{modalPrefixClass}-button {\\n      -webkit-touch-callout: none;\\n      flex: 1;\\n      .button-common();\\n\\n      &:first-child {\\n        color: @color-text-base;\\n      }\\n      &:last-child {\\n        position: relative;\\n        .hairline('left');\\n      }\\n    }\\n  }\\n\\n  &-button-group-v {\\n    .@{modalPrefixClass}-button {\\n      -webkit-touch-callout: none;\\n      display: block;\\n      position: relative;\\n      .hairline('top');\\n      .button-common();\\n    }\\n  }\\n\\n  &-button-active {\\n    background-color: @fill-tap;\\n  }\\n\\n  &-input-container {\\n    margin-top: @v-spacing-md;\\n    .hairline('all', @border-color-base, @radius-sm);\\n  }\\n  &-input {\\n    height: 36 * @hd;\\n    line-height: @line-height-base;\\n\\n    &:nth-child(2) {\\n      position: relative;\\n      .hairline('top');\\n    }\\n    input {\\n      position: relative;\\n      border: 0;\\n      width: 98%;\\n      height: 34 * @hd;\\n      top: 1PX;\\n      box-sizing: border-box;  // maybe not need it ?\\n\\n      margin: 0;\\n      &::placeholder {\\n        font-size: @font-size-base;\\n        color: #ccc;\\n        padding-left: @h-spacing-md;\\n      }\\n    }\\n  }\\n\\n  &&-transparent.@{modalPrefixClass}-android {\\n    .@{modalPrefixClass}-content {\\n      border-radius: 0;\\n\\n      .@{modalPrefixClass}-header {\\n        padding: @v-spacing-md 24 * @hd 12 * @hd;\\n\\n        .@{modalPrefixClass}-title {\\n          text-align: left;\\n          font-size: 21 * @hd;\\n          color: @color-text-base;\\n        }\\n      }\\n\\n      .@{modalPrefixClass}-body {\\n        color: @color-text-base;\\n        text-align: left;\\n        padding: 0 24 * @hd @v-spacing-lg;\\n\\n        .@{modalPrefixClass}-input-container {\\n          .hairline-remove('all');\\n          .hairline('bottom');\\n          .@{modalPrefixClass}-input {\\n            &:first-child {\\n              .hairline-remove('top');\\n            }\\n          }\\n        }\\n      }\\n\\n      .@{modalPrefixClass}-footer {\\n        padding-bottom: 2 * @v-spacing-sm;\\n\\n        .@{modalPrefixClass}-button-group-h {\\n          overflow: hidden;\\n          .hairline-remove('top');\\n          justify-content: flex-end;\\n          padding: 0 2 * @v-spacing-sm;\\n\\n          .@{modalPrefixClass}-button {\\n            flex: initial;\\n            margin-left: 3 * @hd;\\n            padding: 0 @h-spacing-lg;\\n            height: 48 * @hd;\\n            box-sizing: border-box;\\n\\n            &:first-child {\\n              color: #777;\\n            }\\n            &:last-child {\\n              .hairline-remove('left');\\n            }\\n          }\\n        }\\n\\n        .@{modalPrefixClass}-button-group-v.@{modalPrefixClass}-button-group-normal {\\n          display: flex;\\n          justify-content: flex-end;\\n          overflow: hidden;\\n          padding: 0 2 * @v-spacing-sm;\\n\\n          .@{modalPrefixClass}-button {\\n            .hairline-remove('top');\\n            padding: 0 @h-spacing-lg;\\n            margin-left: 3 * @hd;\\n            height: 48 * @hd;\\n fter {\\n        .scale-hairline-common(@color, 0, 0, auto, auto);\\n        width: 1PX;\\n        height: 100%;\\n        background: @color;\\n        transform-origin: 100% 50%;\\n        transform: scaleX(0.5);\\n\\n        @media (min-resolution: 3dppx) {\\n          transform: scaleX(0.33);\\n        }\\n      }\\n    }\\n  }\\n}\\n\\n.hairline(@direction, @color: @border-color-base) when (@direction = 'bottom') {\\n  border-bottom: 1PX solid @color;\\n\\n  html:not([data-scale]) & {\\n    @media (min-resolution: 2dppx) {\\n      border-bottom: none;\\n\\n      &::after {\\n        .scale-hairline-common(@color, auto, auto, 0, 0);\\n        width: 100%;\\n        height: 1PX;\\n        transform-origin: 50% 100%;\\n        transform: scaleY(0.5);\\n\\n        @media (min-resolution: 3dppx) {\\n          transform: scaleY(0.33);\\n        }\\n      }\\n    }\\n  }\\n}\\n\\n.hairline(@direction, @color: @border-color-base) when (@direction = 'left') {\\n  border-left: 1PX solid @color;\\n\\n  html:not([data-scale]) & {\\n    @media (min-resolution: 2dppx) {\\n      border-left: none;\\n\\n      &::before {\\n        .scale-hairline-common(@color, 0, auto, auto, 0);\\n        width: 1PX;\\n        height: 100%;\\n        transform-origin: 100% 50%;\\n        transform: scaleX(0.5);\\n\\n        @media (min-resolution: 3dppx) {\\n          transform: scaleX(0.33);\\n        }\\n      }\\n    }\\n  }\\n}\\n\\n.hairline(@direction, @color: @border-color-base, @radius: 0) when (@direction = 'all') {\\n  border: 1PX solid @color;\\n  border-radius: @radius;\\n\\n  html:not([data-scale]) & {\\n    @media (min-resolution: 2dppx) {\\n      position: relative;\\n      border: none;\\n\\n      &::before {\\n        content: '';\\n        position: absolute;\\n        left: 0;\\n        top: 0;\\n        width: 200%;\\n        height: 200%;\\n        border: 1PX solid @color;\\n        border-radius: @radius * 2;\\n        transform-origin: 0 0;\\n        transform: scale(0
